package LC242;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

public class ValidAnagramTest {

    ValidAnagram obj = new ValidAnagram();


    @Test
    @DisplayName("Example 2: Input : s = \"ab\", t = \"a\"")
    void example2(){
        Assertions.assertFalse( obj.isAnagram("ab","a"));
    }

    @Test
    @DisplayName("Example 1: Input : Long")
    void example1(){
        Assertions.assertFalse( obj.isAnagram("",""));
    }


    @Test
    @DisplayName("Example 3: Input : s = \"anagram\", t = \"nagaram\"")
    void example3(){
        Assertions.assertTrue( obj.isAnagram("anagram","nagaram"));
    }

    @Test
    @DisplayName("Example 4: Input : s = \"ab\", t = \"ba\"")
    void example4(){
        Assertions.assertTrue( obj.isAnagram("ab","ba"));
    }

    @Test
    @DisplayName("Example 5: Input : s = \"rat\", t = \"car\"")
    void example5(){
        Assertions.assertFalse( obj.isAnagram("rat","car"));
    }

}
